import React from "react";
import "./App.css";
import Weather from './components/Weather';
import { API_KEY } from "./constants/index";
import { BASE_URL } from "./constants/index";
function App() {
  return (
    <div className="App">
      <h2>My Daily Weather Forcast</h2>
      <Weather API_KEY={API_KEY} BASE_URL={BASE_URL}/>
    </div>
  );
}

export default App;
